Variable not Defined Outside a Specific Block<p>I am trying to modify my code (in a passport function) so that it reads values form a mongodb Database instead of from an array.</p>
<p>My initial working code was the following:</p>
<pre><code>  passport.use(
   new LocalStrategy(
     {
       usernameField: &quot;email&quot;,
       passwordField: &quot;userName&quot;
     },

     (email, variable, done) =&gt; {

       let user = users.find((user) =&gt; {
         return user.email  === email 
       })

       if (user) {
         done(null, user)
       } else {
         done(null, false, { message: 'Incorrect username or password'})
       }
     }
   )
 )
</code></pre>
<p>The modified code (which is identical to the initial one, at the exception of the code which actually fetches the values from the mongodb) is the following (the actual connection to the mongodb is done in a mongoUtil Module - called here - and is working fine):</p>
<pre><code>  passport.use(
   new LocalStrategy(
     {
       usernameField: &quot;email&quot;,
       passwordField: &quot;userName&quot;
     },

     (email, variable, done) =&gt; {

       var user
       mongoUtil.connectToServer(function(err, client) {
         var db = mongoUtil.getDb()
         db.collection('Users').findOne({email}, function(err, result) {
           user = result
           return user.email === email
         })
       })

       if (user) {
         done(null, user)
       } else {
         done(null, false, { message: 'Incorrect username or password'})
       }
     }
   )
 )
</code></pre>
<p>However the user value is not defined outside the block in which it is used. Since I have declared the value before the block within the function, why is it not defined outside the block in question?</p>

