Mongoose / Mongodb - should I explicitly add objectid to populate?<p>So I have 2 models, one is <code>users</code> and the other is <code>sessions</code>.</p>

<p>It was initially setup as: </p>

<pre><code>const users = mongoose.Schema({
    _id: mongoose.Schema.Types.ObjectId,
    username: {type: String, unique: true},
}
);
module.exports = mongoose.model('User', users,);
</code></pre>

<p>I then went on and added another model, called sessions, </p>

<pre><code>const sessions = mongoose.Schema({
    _id: {type: mongoose.Schema.Types.ObjectId, default: mongoose.Schema.Types.ObjectId, null: false},
    user_id: {type: mongoose.Schema.Types.ObjectId, ref: 'User'},
    timestamp: {type: Date},
});

module.exports = mongoose.model('Sessions', sessions);
</code></pre>

<p>I then decided, I want to to be able to pull the user's sessions along with the users and added 
    <code>sessions: [{type: mongoose.Schema.Types.ObjectId, ref: 'SurfSessions', default: null}]</code> to my users model schema.</p>

<p>I quickly learnt that <code>users.findOne(username:admin).populate('sessions')</code> isn't gonna fill up sessions by itself, as <code>sessions</code> returns as an empty array <code>[]</code>.</p>

<p>Since I don't have <code>sessions</code> inside <code>users</code> populated with <code>objectid</code>'s does that mean I cannot populate <code>sessions</code> or is there another way?</p>

