bson.M {} deepequal does not seem to hande int32<p>I have a function for comparing two structs and making a bson document as input to mongodb updateOne()</p>

<p>Example struct format</p>

<pre><code>type event struct {
    ...
    Name           string
    StartTime      int32
    ... 
}
</code></pre>

<p>Diff function, please ignore that I have not checked for no difference yet.</p>

<pre><code>func diffEvent(e event, u event) (bson.M, error) {
    newValues := bson.M{}       
    if e.Name != u.Name {
        newValues["name"] = u.Name      
    }

    if e.StartTime != u.StartTime {
        newValues["starttime"] = u.StartTime        
    }

    ... 
    return bson.M{"$set": newValues}, nil   
}

</code></pre>

<p>Then I generated a test function like so:</p>

<pre><code>func Test_diffEvent(t *testing.T) {
    type args struct {
        e event
        u event
    }
    tests := []struct {
        name    string
        args    args
        want    bson.M
        wantErr bool
    }{      
        {
            name: "update startime",
            args: args{
                e: event{StartTime: 1},
                u: event{StartTime: 2},
            },
            want:    bson.M{"$set": bson.M{"starttime": 2}},
            wantErr: false,
        },
    }
    for _, tt := range tests {
        t.Run(tt.name, func(t *testing.T) {
            got, err := diffEvent(tt.args.e, tt.args.u)
            if (err != nil) != tt.wantErr {
                t.Errorf("diffEvent() error = %v, wantErr %v", err, tt.wantErr)
                return
            }
            if !reflect.DeepEqual(got, tt.want) {
                t.Errorf("diffEvent() = %v, want %v", got, tt.want)
            }
        })
    }
}
</code></pre>

<p>This fails with a</p>

<pre><code> --- FAIL: Test_diffEvent/update_startime (0.00s)
        models_test.go:582: diffEvent() = map[$set:map[starttime:2]], want map[$set:map[starttime:2]]
</code></pre>

<p>For me this seem to be the same. I have played around with this and bool fields, string fields, enum fields, and fields as struct or fields as arrays of structs seems to work fine with deepequal, but it gives an error for int32 fields. </p>

<p>As a go beginner; what am I missing here? I would assume that if bool/string works then int32 would too.</p>

